        <PostCard logo={docker} />
        <PostCard logo={css} />
        <PostCard logo={css}/>
        <PostCard logo={docker} />
        <PostCard logo={laravel} />
        <PostCard logo={css}/>
        <PostCard logo={js} />
        <PostCard logo={docker} />
        <PostCard logo={php} />
        </div>
      </div>
    </>
  );
};

export default PostcardView;
